import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  container: {
    position: 'relative',
    top: '0px',
    width: '33vw',
    margin: '64px',
    background: 'rgba(19, 100, 0, 1)',
  }
}));

export default function Header() {
  const classes = useStyles();

  return (
  <div className={classes.container}>
    GAME THEORY 
  </div>
  );
}
